import styled from 'styled-components';

export const Wrapper = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0px;
  padding: 0px;
  height: 100vh;
`;

export const Form = styled.div`
  background-color: #f1f3f5;
  border: 1px solid #e9ecef;
  width: 20%;
  height: 20%;
`;
